import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import InputLabel from '@material-ui/core/InputLabel';
import FormHelperText from '@material-ui/core/FormHelperText';
import FormControl from '@material-ui/core/FormControl';
import Select from '@material-ui/core/Select';
import NativeSelect from '@material-ui/core/NativeSelect';
import Calendar from '../../pictures/calendar.png'


const useStyles = makeStyles((theme) => ({
    formControl: {
      margin: theme.spacing(1),
      minWidth: 120,
    },
    selectEmpty: {
      marginTop: theme.spacing(2),
    },
    container: {
        padding: '10px',
        borderRadius: '25px',
        backgroundColor: 'blue',
        width: "300px"
    }


  }));

  export default function Dropdown() {
    const classes = useStyles();
    const [state, setState] = React.useState({
      time: '',
    });

    const handleChange = (event) => {
      const name = event.target.name;
      setState({
        ...state,
        [name]: event.target.value,
      });
    };

    return (
      <div>

          <div className = {classes.container} style = {{display: 'flex'}} >
            <img src={Calendar} alt="calendar" style= {{width: '100%', padding: '50px'}}/>
                <FormControl className={classes.formControl}>
                <NativeSelect
                    value={state.time}
                    onChange={handleChange}
                    name="time"
                    className={classes.selectEmpty}
                    inputProps={{ 'aria-label': 'time' }}
                >
                    <option value="">Last Week</option>
                    <option value={10}>1 Month</option>
                    <option value={20}>3 Months</option>
                    <option value={30}>6 Months</option>
                </NativeSelect>
                <FormHelperText>Select time frame</FormHelperText>
                </FormControl>

          </div>



      </div>
    );
  }
